def solve():
    s = "t152 t62 t66 t179 t103 t26 t129 t145 t94 t96 t129 t169 t26 t129 t179"

    graph = {}
    for char in s:
        if char not in graph:
            graph[char] = []
        graph[char].append(char)

    def is_valid(string):
        visited = set()
        q = [string]

        while q:
            curr = q.pop(0)
            if curr in visited:
                continue
            visited.add(curr)

            if curr in graph:
                for neighbor in graph[curr]:
                    q.append(neighbor)

        return len(visited) == len(graph)

    print(is_valid(string))

